  }

  fetchData((url) => {
    axios.get("http://localhost:8080/api/film/ranking/" + url)
    .then(res => {
        console.log(res.data)
        setList(res.data)
        })
    .catch(err => {
        console.log(err)
    })
}, [setList]);


